import React from "react";
import SquareList from './SquareList'


function Projects() {
  return (
    <>
      <div className="page-container">
        <div className="container">

          <h3 style={{color: '#ED0BFF'}}>From design to development </h3>
          <p>
          To start, I will show some of the projects I have developed... 
          Eventually I will write down how and why I solved coding problems, and reveal hurdles in my workflow.
            </p>
          <SquareList />
        </div>

      </div>
    </>
  );
}

export default Projects;
